import React from 'react';
import { Route, Navigate } from 'react-router-dom';

export default function PublicRoute({ children }) {
    const auth = localStorage.getItem('token');
  

    if (!auth) {
        //navigate('/login');
        return <Navigate to="/login" />;
        
    }

    return <>{children}</>;
}
